import React, { Component, Fragment } from "react";
import { Container, Row } from "react-bootstrap";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

export default class Review extends Component {
  render() {
    var settings = {
      autoplaySpeed: 3000,
      autoplay: true,
      dots: true,
      speed: 3000,
      infinite: false,
      vertical: true,
      verticalSwiping: true,
      slidesToShow: 1,
      slidesToScroll: 1,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            infinite: true,
            dots: true,
          },
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2,
          },
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
          },
        },
      ],
    };
    return (
      <Fragment>
        <Container className="text-center">
          <h1 className="serviceMainTitle">CLIENT SAYS</h1>
          <Slider>
            <div>
              <Row></Row>
            </div>
          </Slider>
        </Container>
      </Fragment>
    );
  }
}
